import wx
def getTBIcon(self, status):
    icon = EmptyIcon()
    relay_status = status
    if relay_status == 0:
        imgPath = os.path.join(UtilFunc.module_path(), 'res/popocloud_unlogin.png')
    if relay_status == 1:
        imgPath = os.path.join(UtilFunc.module_path(), 'res/popocloud_error.png')
    if relay_status == 2:
        imgPath = os.path.join(UtilFunc.module_path(), 'res/popocloud_ico.png')
    if relay_status == 3:
        imgPath = os.path.join(UtilFunc.module_path(), 'res/popocloud_error.png')
    icon.CopyFromBitmap(wx.Image(imgPath, wx.BITMAP_TYPE_PNG).ConvertToBitmap())
    return icon

def getAppIcon():
    icon = EmptyIcon()
    imgPath = os.path.join(UtilFunc.module_path(), 'res/popocloud_ico.ico') 
    icon.CopyFromBitmap(wx.Image(imgPath, wx.BITMAP_TYPE_ICO).ConvertToBitmap())
    return icon
